import React from 'react'
import {CCard, CCardBody, CCardHeader, CListGroup, CListGroupItem} from "@coreui/react";
import Cookies from "universal-cookie/index";
import * as axios from "axios";

class Feeds extends React.Component {

    constructor(props) {
        super(props);


    }

    componentDidMount() {


        const cookies = new Cookies();

        axios.get('http://localhost:3000/usersnews/',
            {
                headers: {

                    Authorization: cookies.get('token')
                }
            }
        )
            .then(response => {

                console.log(response.data)
                const data = response.data

                this.setState({
                    newsList: data
                })

                console.log("o/p" + this.state.newsList)
            })


    }


    render() {
        return (

            <CCard>
                <CCardHeader>
                    News Feeds
                    <small></small>
                </CCardHeader>
                <CCardBody>

                    <CListGroup>

                        <CListGroupItem action>
                            <h5>List group item heading</h5>
                            <div>
                                Donec id elit non mi porta gravida at eget metus. Maecenas sed diam eget risus varius
                                blandit.
                            </div>
                            <small>Small.</small>
                        </CListGroupItem>

                    </CListGroup>

                </CCardBody>
            </CCard>
        )
    }


}

export default Feeds
